const inputLand = document.getElementById("inputCountry");
const button = document.getElementById("buttonSubmit");
const select = document.getElementById("choose");
const weatherContainer = document.querySelector('.displayWeather')
const errorElement = document.querySelector('#errorMessage')
const myImage= document.getElementById("myImage")



function getWeather() {

   let inputcountry = inputLand.value;
   if (inputcountry === "") {
    errorElement.textContent = "You need to fill Location";
     weatherContainer.innerHTML=""
    return;
  }
  errorElement.textContent = "";

  let theUrl;
  if (select.value === "forecast") {
    theUrl = `http://api.weatherapi.com/v1/forecast.json?key=48d14da081874cbbb0504806242506&q=${inputcountry}&days=7&aqi=no&alerts=no`;
  }
  if (select.value === "current") {
    theUrl = `http://api.weatherapi.com/v1/current.json?key=48d14da081874cbbb0504806242506&q=${inputcountry}&aqi=no`;
  }


  console.log(select.value)

  fetch(theUrl, {mode:"cors"})
    .then((response) => {

      if(!response.ok){
        weatherContainer.innerHTML=""
        throw new Error(`${response.status}`)
      }

      inputLand.value=""
       weatherContainer.innerHTML=""
   
      return response.json();
    })
    .then((data) => {
      console.log(data)
      weatherContainer.innerHTML=`
      
   
    <div class="condition">
      <div class="icon"><img src="https:${data.current.condition.icon}"></div>
      <div class="temperature"><span>${data.current["temp_c"]}</span></div>
      <div class="additional">
        <div class="humidity"><span>Humidity:${data.current.humidity}</span></div>
        <div class="precipitation"><span>Precipitation:${data.current["precip_in"]}</span></div>
        <div class="wind"><span>Wind:${data.current["wind_mph"]}</span></div>
      </div>
    </div>
    <div class="location-time">
      <div class="header"><span>Weather</span></div>
      <div class="local-time"><span>${data.location.localtime}</span></div>
      <div class="text"><span>${data.current.condition.text}</span></div>
    </div>`
    

    })
    .catch(err => {
    console.log(err)

     errorElement.textContent= `Error: ${err.message}`;
  
  });
} 

button.addEventListener("click", function (event) {
  event.preventDefault();
  getWeather();
 
});

inputLand.addEventListener("keydown", function(event){

  if(event.key==="enter") {
    getWeather()


  }
 
})





